  `id` int(11) NOT NULL AUTO_INCREMENT,
  `account` varchar(50) DEFAULT NULL COMMENT '账号/登录名',
  `password` varchar(100) DEFAULT NULL COMMENT '密码',
  `name` varchar(100) DEFAULT NULL COMMENT '代理商名称',
  `code` varchar(11) DEFAULT NULL COMMENT '套餐',
  `status` int(11) DEFAULT '2' COMMENT '代理商状态',
  `amount` double(10,2) DEFAULT '0.00' COMMENT '账户金额',
  `real_amount` double(10,2) DEFAULT '0.00' COMMENT '实际可用金额',
  `salt` varchar(50) DEFAULT NULL,
  `ctime` datetime DEFAULT NULL,
  `role` varchar(255) DEFAULT 'AGENT',
  `contacts` varchar(255) DEFAULT NULL,
  `intention` varchar(255) DEFAULT NULL,
  `phone` varchar(255) DEFAULT NULL,
  `remark` varchar(255) DEFAULT NULL,
  `weixin` varchar(255) DEFAULT NULL,
  PRIMARY KEY (`id`)
) ENGINE=InnoDB AUTO_INCREMENT=14 DEFAULT CHARSET=utf8 COMMENT='代理商页面';

